css:
.fb-rating-jewel:not([data-fb-rating='0'])::after {
  color: #aaa;
  font-size: 0.8em;
  margin-top: 13px;
  position: absolute;
  content: attr(data-fb-rating);
}
.fb-rating-badged-if-zero.fb-rating-jewel[data-fb-rating='0']::after {
  background-color: #0098ff;
  border-radius: 6px;
  color: #fff;
  font-size: 0.8em;
  font-weight: bold;
  height: 12px;
  line-height: 12px;
  margin-left: -3px;
  margin-top: 5px;
  position: absolute;
  width: 12px;
  content: "!";
}
.fb-rating-stars-no-selection:not(:hover) {
  opacity: 0.5;
}
.fb-rating-stars {
  margin-top: 10px;
}
.fb-rating-stars .icon-star {
  cursor: pointer;
  display: inline-block;
  padding-left: 3px;
  padding-right: 3px;
}
.fb-rating-stars .icon-star::before {
  font-size: 24px;
  width: 24px;
  height: 24px;
  margin-right: 0px;
}
.fb-rating-stars .icon-star::after {
  content: attr(data-star-rating);
  display: block;
}
.fb-rating-stars .icon-star:hover ~ .icon-star {
  opacity: 0.3;
}
.fb-rating-stars:not(:hover) .icon-star.fb-rating-selected ~ .icon-star {
  opacity: 0.3;
}
.fb-rating-stars .icon-star[data-star-rating='1'] {
  color: #c00;
}
.fb-rating-stars .icon-star[data-star-rating='2'] {
  color: #e64c17;
}
.fb-rating-stars .icon-star[data-star-rating='3'] {
  color: #ff982d;
}
.fb-rating-stars .icon-star[data-star-rating='4'] {
  color: #95b952;
}
.fb-rating-stars .icon-star[data-star-rating='5'] {
  color: #2BDA77;
}
.fb-rating-comment-editor {
  display: flex;
  height: 10em;
  margin-bottom: 10px;
  margin-top: 20px;
  overflow: auto;
}
.fb-rating-comment-editor atom-text-editor {
  background: #333;
  padding: 10px;
}
